import LandingButton from './../../components/LandingButton.js'
import Header from './../../components/Header.js'

import './Landing.css';

function Landing() {
  return (
      <div class="landing">
            <h1> STAT 198 </h1>
            <h2> Introduction to Poker </h2>

            <p><b>Instructors: </b> Kevin An, Aidan Reilly</p>
      </div>
  );
}

export default Landing;
